    def validate(n, m, D, edges):
        def is_edge(a, b):
            return a!= b and edges.count(a) == 1 and edges.count(b) == 1

        v = set()
        u = set()
        for e in edges:
            if is_edge(e[0], e[1]):
                return False
            if e[0] in v:
                return False
            v.add(e[0])
            if e[1] in u:
                return False
            u.add(e[1])

        deg = defaultdict(int)
        for e in edges:
            deg[e[0]] += 1
            deg[e[1]] += 1

        deg_v = deg[1]
        deg_u = deg[1]
        deg_rest = n - 2 - deg_v - deg_u

        if deg_u == D or deg_v == D:
            return True

        if deg_u > deg_rest:
            return False

        if deg_u == deg_rest:
            return deg_v == D or deg_u == D

        return deg_u == deg_rest and deg_v == D

    n, m, D = map(int, stdin.split())
    edges = list(map(lambda x: list(map(int, x.split())), stdin.split('\n')[1:]))
    return "YES" if validate(n, m, D, edges) else "NO"

