    def dijkstra_search(graph, start):
        distances = {vertex: float('infinity') for vertex in graph}
        distances[start] = 0
        vertices_to_visit = {start}

        while vertices_to_visit:
            current_vertex = min(
                vertices_to_visit, key=lambda vertex: distances[vertex])
            vertices_to_visit.remove(current_vertex)

            for neighbour in graph[current_vertex]:
                alternative_route = distances[current_vertex] + 1

                if alternative_route < distances[neighbour]:
                    distances[neighbour] = alternative_route

        return distances

    n, k = map(int, stdin.split())
